import React from 'react';
import styled from 'styled-components';

const AppWrapper = styled.div`
  text-align: center;
`;
const Left = () => {
  return (
    <div className="left-container">
      <div className="left-container__content"> Left </div>
    </div>
  );
};

export default Left;
